import logo from './logo.svg';
import './App.css';
import Customer from './components/Customer';

const customer={
  'id':1
  ,'image':'https://placeimg.com/64/64/any'
  ,'name':'조승진'
  ,'birthday':'960807'
  ,'gender':'남'
  ,'job':'대학생'

}


function App() {
  return ( 
    <Customer
      id={customer.id}
      image ={customer.image}
      name={customer.name}
      birthday={customer.birthday}
      gender={customer.gender}
      job={customer.job}
    />
  );
}

export default App;
